css:
/*
** THEME VARIABLES
*/
/* stylelint-disable */
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #000000;
}
.timecop .panels {
  display: flex;
  flex-direction: row;
}
.timecop .package-panel {
  display: flex;
  flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .text-info {
  margin-bottom: 0.5em;
}
.timecop .timing,
.timecop .list-item {
  display: flex;
  justify-content: space-between;
}
.timecop .timing .inline-block:last-child,
.timecop .list-item .inline-block:last-child {
  margin-right: 0;
}
.timecop .timing {
  margin-bottom: 0.5em;
}
.timecop .list-item {
  margin-top: 0.25em;
  margin-bottom: 0.25em;
}
.timecop .package {
  color: #dfe1e0;
}
.timecop .package:hover {
  text-decoration: none;
  color: #dfe1e0;
}
.timecop .timecop-line {
  flex: 1 1 0;
  margin-right: 0.5em;
  margin-top: .80em;
  border-top: 1px dashed rgba(223, 225, 224, 0.2);
}
.timecop .package:hover + .timecop-line {
  border-color: rgba(223, 225, 224, 0.6);
}
